import React 	from 'react';
import './beta.css';

export default class BetaPage extends React.Component {
	render() {
		return (
			<div id="beta-container">
				<div id="beta-image">
					<h2>beta</h2>
				</div>
				<div id="beta">
					<h4>Season</h4>
					<p></p>
					<h4>Gear</h4>
					<p></p>
					<h4>Food</h4>
					<p></p>
					<h4>Climbing</h4>
					<p></p>
				</div>
			</div>
		);
	}
}
